      masterdata_term_and_conditions:
        'ข้าพเจ้ารับทราบ ขอรับรองและยืนยันว่า\n\t1. ตัวแทนประกันได้ปฎิบัติตามหลักเกณฑ์ วิธีการออกการเสนอขายกรมธรรม์ ตามที่ทาง คปภ. ได้ลงนามในประกาศ ดังต่อไปนี้\n\t2. ตัวแทนประกันได้นำเสนอขายกรมธรรม์ประกันภัย โดยใช้วิธีการสื่อสารผ่านอุปกรณ์อิเล็กทรอนิกส์ โดย เสียง และ/หรือภาพ\n \t3. ตัวแทนประกันใช้วิธีการสื่อสารผ่านอุปกรณ์อิเล็กทรอนิกส์โดยข้อความ เสียง และ/หรือภาพ และได้ขออนุญาติจัดเก็บบทสนทนาระหว่างลูกค้าและตัวแทนประกัน การเสนอขายกรมธรรม์ประกันภัย ได้มีการบันทึกเสียงหรือภาพการสนทนาไว้ โดยตัวแทนประกันต้องอธิบายข้อมูลเกี่ยวกับกรมธรรม์ประกันภัยที่เสนอขาย โดยใช้เอกสารประกอบการเสนอขายที่ได้รับความเห็นชอบจากบริษัท\n\t4. กรณีลูกค้าสนใจทำประกันภัย ตัวแทนประกันได้สอบถามข้อมูลต่างๆ เพื่อกรอกข้อมูลของลูกค้าในใบคำขอเอา <span class="nowrap">ประกันภัย</span>และเอกสารประกอบการเสนอขาย และส่งให้ลูกค้าตรวจสอบความถูกต้องผ่านช่องทางอิเล็กทรอนิกส์ เช่น <span class="nowrap">แอพพลิเคชั่น</span> ที่ตกลงกับลูกค้า ไปรษณีย์อิเล็กทรอนิกส์ (E-mail) หรือการส่งข้อความ SMS\n\t5. กรณีลูกค้าตกลงทำประกันภัย ให้ลูกค้าส่งข้อความยืนยัน พร้อมส่งภาพบัตรประชาชน คำขอเอาประกันภัย และหลักฐานการชำระเบี้ยประกันภัยเข้าบัญชีบริษัท โดยวิธีทางอิเล็กทรอนิกส์ได้เช่นเดียวกัน และเมื่อบริษัทได้รับชำระเบี้ยประกันภัยแล้ว บริษัทจะออกเอกสารการรับเงินโดยใช้วิธีการทางอิเล็กทรอนิกส์ให้กับลูกค้าทันที\n\t6. เมื่อบริษัทตกลงรับประกันภัย บริษัทจะส่งกรมธรรม์ประกันภัยโดยใช้วิธีการที่ลูกค้าเลือก และเริ่มนับระยะเวลาขอยกเลิกกรมธรรม์ประกันภัย (Free Look Period) ตั้งแต่วันที่กรมธรรม์ประกันภัยไปถึงผู้เอาประกันภัย ทั้งนี้ บริษัทต้องส่งมอบกรมธรรม์ประกันภัยและเอกสารแสดงการรับเงินฉบับจริงให้ผู้เอาประกันภัยด้วย ในกรณีที่ลูกค้ามีความประสงค์จะขอให้บริษัทออกกรมธรรม์ประกันภัยโดยใช้วิธีการทางอิเล็กทรอนิกส์ ลูกค้าจะต้องแสดงเจตนาโดยชัดแจ้ง',
